Query array by stored index in document in MongoDB<p>I have a document like this</p>

<pre><code>{
    "status": {
        "current": 0,
        "priority": [{
            "operationName": "PHOTO",
            "status": "WAITING"
        },
        {
            "operationName": "DESIGN",
            "status": "NOTARRIVED"
        },
        {
            "operationName": "COLOR_SEPARATION",
            "status": "NOTARRIVED"
        }]
    }
}
</code></pre>

<p>and want to query on data like this</p>

<pre><code>{
    "status.priority.$status.current.operationName": {
        $in: ['SERVICES', 'PHOTO']
    }
}
</code></pre>

<p>when I query like this</p>

<pre><code>{
    "status.priority.0.operationName": {
        $in: ['SERVICES', 'PHOTO']
    }
}
</code></pre>

<p>it returns the data needed as the <code>'PHOTO'</code> is the current operation.</p>

<p>I need to query based on an index of the array and this index is stored in the document in <code>status.current</code></p>

<p>any hint?</p>

<p><strong>UPDATE</strong>
After question solved I want to optimize it.</p>

