Updating an array of an array in mongoDB using mongoose<p>I'm trying to update a document in my mongoDB which contains nested array.<br>
The situation is as follows: </p>

<p>I have a newsItem model, which can contain a poll object. this poll object has: title, totalVotes and options. option is an array of objects, these object contain: optionName and optionVotes. In each of these objects. the optionVotes is an array which contains the Id's of the users who voted on them. (because i want to track who voted on what and how many i want to prevent voting twice)</p>

<p>So it should look something like this:</p>

<pre><code>{
    "_id" : ObjectId("5bb7487727430319f5c18495"),
    "poll" : {
        "totalVotes" : 0,
        "title" : "test",
        "options" : [ 
            {
                "optionName" : "Burgers",
                "optionVotes" : []
            }, 
            {
                "optionName" : "Pizza",
                "optionVotes" : []
            }, 
            {
                "optionName" : "Fish",
                "optionVotes" : []
            }, 
            {
                "optionName" : "BBQ",
                "optionVotes" : []
            }, 
            {
                "optionName" : "Soup",
                "optionVotes" : []
            }, 
            {
                "optionName" : "Pasta",
                "optionVotes" : []
            }
        ]
    }
}
</code></pre>

<p>What i am trying to do now is, whenever the api route /news/votes/:id gets called, it will update the newsitem with :id and put the users id in the given voteoption. (which is in the body)
So in the request i have: user id and the voted optionName</p>

<p>This is what i got at the moment which is not working for me: </p>

<pre><code>exports.vote = (req, res) =&gt; {
    News.findOneAndUpdate({ _id: req.params.id }).exec((err, newsItem) =&gt; {
        let tempItem = newsItem
        for (let i = 0; i &lt; tempItem.poll.options.length; i++) {
            if (tempItem.poll.options[i].optionName === req.body.optionName) {
                tempItem.poll.options[i].optionVotes.push(req.user._id)
            }
        }
        console.log(tempItem.poll.options[0])
        tempItem.save(err =&gt; {
            if (!err) {
                return res.status(200).send()
            }
        })
    })
}
</code></pre>

<p>the weird thing is, when i do for example:</p>

<p>tempitem.poll.title = 'new title'
tempitem.save()</p>

<p>then the title does get updated in the databank!
the console.log in the code does output the correct object though..</p>

<p>I also tried using the more standard way of:</p>

<pre><code>findOneAndUpdate({ _id: req.param.id }, {$addToSet: {.....}}).exec(...)
</code></pre>

<p>But that way i have actually no clue how to get an object with a specific key from an array and then update a part of that object.</p>

<p>2 other options i was thinking about:</p>

<ul>
<li>Extracting the whole poll object to another document and then using a
reference in the newsItem.. but that is not solving the problem
either (also feels to SQL)</li>
<li>Not putting the array of voted users in each voteoption but just make
a user array of all people who voted. --> disadvantage: i can't look
up who voted on what..</li>
</ul>

