Add object to array of objects if object doesn't exist, otherwise update object<p><strong>Desired Behaviour</strong></p>

<p>Add object to array of objects if it doesn't exist, otherwise update object.  </p>

<p>Each user can only add one rating.  </p>

<p><strong>Schema</strong></p>

<pre><code>"ratings" : [ 
    {
        "user_email" : "john@smith.com",
        "criteria_a" : 0,
        "criteria_b" : 3,
        "criteria_c" : 1,
        "criteria_d" : 5,
        "criteria_e" : 2
    },
    {
        "user_email" : "bob@smith.com",
        "criteria_a" : 1,
        "criteria_b" : 3,
        "criteria_c" : 5,
        "criteria_d" : 2,
        "criteria_e" : 1
    },
    {
        "user_email" : "jane@smith.com",
        "criteria_a" : 5,
        "criteria_b" : 3,
        "criteria_c" : 1,
        "criteria_d" : 0,
        "criteria_e" : 1
    }
]
</code></pre>

<p><strong>What I've Tried</strong></p>

<p>I've read this:</p>

<blockquote>
  <p>The <code>$addToSet</code> operator adds a value to an array unless the value is
  already present, in which case <code>$addToSet</code> does nothing to that array.  </p>
</blockquote>

<p>Source:  <a href="https://docs.mongodb.com/manual/reference/operator/update/addToSet/" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/operator/update/addToSet/</a></p>

<p>But I'm a bit confused because I think I am trying to:</p>

<ul>
<li><code>$addToSet</code> if object doesn't exist</li>
<li><code>$set</code> (ie update the existing object) if it does exist</li>
</ul>

<p>The following keeps adding <code>rating</code> objects to the array, even if a user has already added a rating.    </p>

<pre><code>var collection = mongo_client.db("houses").collection("houses");

var o_id = new ObjectID(id);

var query = { _id: o_id, "ratings.user_email": user_email };

var update = { $addToSet: { ratings: rating } };

var options = { upsert: true };

collection.updateOne(query, update, options, function(err, doc) {
    if (err) {
        res.send(err);
    } else {
        res.json({ doc: doc })
    }
});
</code></pre>

<p><strong>Edit:</strong></p>

<p>The following works if a user has already submitted a rating, but otherwise it throws the error <code>The positional operator did not find the match needed from the query.</code>:</p>

<pre><code>var update = { $set: { "ratings.$": rating } };
</code></pre>

