Matching/filtering directly on an aggregate of a field<p>In a MongoDb aggregation pipeline, I often encounter wanting to filter on an operation of a member field (i.e. size of a list). Is it possible doing this in one operation, rather than projecting a variable first, and then matching?</p>

<p>This is what I usually do:</p>

<pre><code>[
  {
    "$project": {
      "vector_size": { "$size": "$VectorField" }
    }
  },
  {
    "$match": {
      "vector_size": { "$gte": 7 }
    }
  }
]
</code></pre>

<p>I would prefer a one-off, something like:</p>

<pre><code>[
  {
    "$match": {
      "VectorField": { "$size": { "$gte": 7 } }
    }
  }
]
</code></pre>

<p>But for that operation <code>$size</code> expects an integer, and not another operation.
It it possible?</p>

